import * as style from "../../css/light/focusedList";
import ProfileHistory from './profileHistory';
import AssociatedItem from './associatedItem';

let focusedContainer = {
  width: "100%", 
  marginTop: "35px", 
  height: "825px", 
  border: "1px solid #e8fefd"
}

let focusedClose = {
  userSelect: "none", 
  fontSize: "25px", 
  cursor: "pointer", 
  lineHeight: "17px", 
  width: "auto", 
  transform: "rotate(45deg)", 
  marginRight: "5px",
  marginLeft: "auto"
} 

function FocusedTitle({setFocused, focusedItem}) {
  return (
    <div style={style.focusedTitleContainer}>
      <div style={{width: "100%"}}></div>  
      <div style={style.focusedItemTitle}>{focusedItem.resources[0].data.userid}</div>
      <div style={{display: "flex", width: "100%"}}>
        <div onClick={() => {setFocused([])}} style={focusedClose}>+</div>
      </div>
    </div>
  )
}


export default function FocusedList({focused, setFocused}) {
  if (!focused[0]) return <div></div>
  let focusedItem = require(`../../data/${focused[1]}/${focused[0]}.json`)

  if (focusedItem.resources[0].data.associatedDevices) {
    return (
      <div style={focusedContainer}>
        <FocusedTitle setFocused={setFocused} focusedItem={focusedItem}/>
        {/* <div style={style.focusedItemDD}>
          <AssociatedItem profile={item} title={item[3]}/>
          <ProfileHistory profile={[item[0].resources[0].data[item[1]], item[2]]}/>
        </div> */}
      </div>
    )
  }

